if [[ ! -d $(nix store add-path --name source --dry-run .) ]]; then nix store add-path --name source . (cd ./src/local && nix flake lock --update-input std) (cd ./src/tests && nix flake lock --update-input std)
fi # shellcheck disable=SC1090
. "$(fetchurl "https://raw.githubusercontent.com/paisano-nix/direnv/main/lib" "sha256-IgQhKK7UHL1AfCUntJO2KCaIDJQotRnK2qC4Daxk+wI=")" use envreload //local/shells/default //local/configs NOTE: In the above code use std cells //std/... refers to the folder where Cells are grown from. If your folder is e.g. nix, adapt to use std nix //... and so forth. It is used to automatically set up file watches on files that could modify the current devshell, discoverable through these or similar logs during loading: direnv: loading https://raw.githubusercontent.com/divnix/std/...
